import Done from "../Icons/DoneIcon";
export const CircleCheck: FC<{ checked: boolean; position: "left" | "right"; onClick?: MouseEventHandler }> = (props) => {
  if (props.checked) {
    return (
      <div className={`circle-selected circle-${props.position}`} onClick={props.onClick}>
        <Done color='white' />
      </div>
    );
  } else {
    return <div className={`circle circle-${props.position}`} onClick={props.onClick}></div>;
  }
};

